import React from 'react';
import './styles/About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>
        Welcome to our company! We are dedicated to providing the best services to our clients.
        Our team of experts is here to help you achieve your goals.
      </p>
      <p>
        Our mission is to deliver high-quality solutions that meet the needs of our customers.
        We believe in innovation, integrity, and excellence in everything we do.
      </p>
      <p>
        Thank you for choosing us. We look forward to working with you!
      </p>
    </div>
  );
};

export default About;
